webpackJsonp([28226720108805],{781:function(A,e){A.exports={data:{markdownRemark:{headings:[],html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 76.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Yokko Mobile Application"\n        title=""\n        src="/the-next-website/static/yokko2-eca2d5a00f36c99fc346b637f7ac06c5-755ae.jpg"\n        srcset="/the-next-website/static/yokko2-eca2d5a00f36c99fc346b637f7ac06c5-f07fc.jpg 125w,\n/the-next-website/static/yokko2-eca2d5a00f36c99fc346b637f7ac06c5-9d06f.jpg 250w,\n/the-next-website/static/yokko2-eca2d5a00f36c99fc346b637f7ac06c5-755ae.jpg 500w,\n/the-next-website/static/yokko2-eca2d5a00f36c99fc346b637f7ac06c5-63ca3.jpg 750w,\n/the-next-website/static/yokko2-eca2d5a00f36c99fc346b637f7ac06c5-9b9a3.jpg 1000w,\n/the-next-website/static/yokko2-eca2d5a00f36c99fc346b637f7ac06c5-6e031.jpg 1500w,\n/the-next-website/static/yokko2-eca2d5a00f36c99fc346b637f7ac06c5-738ec.jpg 4500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The connection between a mother and a baby begins from the moment of conception.  With the mobile application Yokko, women are able to better connect with their children throughout their journey as one. The application is designed to track the baby’s size, weight,  heart rate, movement, and positioning.  A wearable strap accompanies the application to ensure the data is personalized.  This data is then visualized via the image of an egg - as the baby develops, so does the imagery.  Yokko enables parents carefully monitor their baby’s development without having to leverage medical personnel. In addition, if complications do occur, Yokko can help those expecting discover complications sooner and action them more readily. Yokko is available on both mobile and watch applications.</p>',frontmatter:{title:"Yokko",graduate:"Sarah Keast",category:"Product Design",category2:"UI/UX",category3:null,image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/the-next-website/static/yokko-b59c83d64e65d0a8c7167e398b8fe807-a7a62.jpg",srcSet:"/the-next-website/static/yokko-b59c83d64e65d0a8c7167e398b8fe807-5a1a9.jpg 375w,\n/the-next-website/static/yokko-b59c83d64e65d0a8c7167e398b8fe807-0908c.jpg 750w,\n/the-next-website/static/yokko-b59c83d64e65d0a8c7167e398b8fe807-a7a62.jpg 1500w,\n/the-next-website/static/yokko-b59c83d64e65d0a8c7167e398b8fe807-bda60.jpg 2250w,\n/the-next-website/static/yokko-b59c83d64e65d0a8c7167e398b8fe807-cb414.jpg 3000w,\n/the-next-website/static/yokko-b59c83d64e65d0a8c7167e398b8fe807-dc7f2.jpg 4500w,\n/the-next-website/static/yokko-b59c83d64e65d0a8c7167e398b8fe807-eb4b3.jpg 6000w",sizes:"(max-width: 1500px) 100vw, 1500px"}}}}}},pathContext:{slug:"/work/yokko/",name:"Yokko"}}}});
